import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import App from './App';
import { gsap } from 'gsap';

// GSAP animation for initial load
gsap.set('body', { opacity: 0 });

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
